  false,\n\t\"url\": null,\n\t\"notes\": \"It is determined in this document that
  recreational fishing of bass and brim on St. Vincent National Wildlife Refuge is
  consistent with Refuge Objectives.  The stipulations necessary to ensure compatibility
  include: law enforcement; restricting fishing hours to daylight; closing the lake
  system during bald eagle season; and limiting lake transportation to non-motorized
  boats.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
